  [],\n\t\"revision_timestamp\": \"2016-07-27T22:21:46.361349\",\n\t\"name\": \"special-report-on-the-floral-and-faunal-survey-of-the-lower-souris-refuge-with-brief-notes\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"It is to be understood that the information
  [contained in this report] is far from complete. There are several reasons, including
  the fact that there is but little time available for this work. Most of our observations
  have been made while pursuing other forms of activity. However, these lists should
  have some value, especially for the future references, and for comparative purposes.
  Total observations extend from July 1, 1935 to December 31, 1936. As was to be expected,
  during 1936, we found some more or less radical changes in wildlife due to the creation
  of a vast new marsh. By comparing this report with the one prepared last year, these
  differences will readily be noted. In a few cases it will be noted that I have given
  subspecific names. This has been done only when I have been definitely sure of my
  grounds, usually through the means of museum identification.\",\n\t\"license_title\":
